import React, { Component } from 'react';
import '../App.css';
import logo from '../projectpictures/GitHub_Logo_White.png';


class Home extends Component {
  render() {
    return (

      <div className="App">


<div class="container-fluid" id="maincontainer">

<div class ="row" id="rowheading">
<div class="col">
<p class="text-center" id="helloheading2">We are <span id="microsoft">MyCrowSawft</span> </p>
<p class="text-cenert" id="firstpara"> <br></br>  </p>
</div>
</div>


<div class ="row" id="rowheading2">
<div class="col">
<p class="text-center"> join us on <span id="github" class="img-fluid" > <img src={logo} class="img-fluid" alt="GITHUB"></img></span> </p>
<p class="text-cenert" id="firstpara"> <br></br>  </p>
</div>
</div>


<div class ="row" id="rowsingleline">
<div class="col-lg-6 col-md-6 col-sm-12 col-xs-12">
<p class="text-left" id="singlepara">    </p>
</div>
</div>
<div class="container" id="footer">  </div>
</div>
      </div>
    );
  }
}

export default Home;
